import React, { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import axios from 'axios';
import { Link } from 'react-router-dom';

const API_BASE_URL = process.env.REACT_APP_API_BASE_URL;

const StudentManagement = () => {
  
  const [students, setStudents] = useState([]);
  const [selectedStatus, setSelectedStatus] = useState(0); // 추가된 상태변수

  useEffect(() => {
    axios.get(`${API_BASE_URL}/StuLoad`)
      .then(response => {
        setStudents(response.data);
      })
      .catch(error => {
        console.error('데이터를 불러오는 데 실패했어', error);
      });
  }, []);

  // 필터링된 학생 목록
  const filteredStudents = selectedStatus === 0 ? students : students.filter(student => student.StudentState === selectedStatus);

  return (
    <div className="container ">
      <h1 className="mt-3 mb-3">학생 관리</h1>
      <div className="mb-3 d-flex justify-content-between">
        <div>
        <button className="btn btn-primary" style={{ marginRight: '10px' }} onClick={() => setSelectedStatus(0)}> 전체 신청자</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }} onClick={() => setSelectedStatus(1)}>줌미팅 등록</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }} onClick={() => setSelectedStatus(2)}>줌미팅 완료</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }} onClick={() => setSelectedStatus(3)}>재학 학생</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }} onClick={() => setSelectedStatus(4)}>휴학 학생</button>
          <button className="btn btn-secondary" style={{ marginRight: '10px' }} onClick={() => setSelectedStatus(5)}>졸업 학생</button>
        </div>
        <Link to="/signup">
              <button className="btn btn-secondary">학생 생성</button>
        </Link>
      </div>
      <table className="table table-striped" style={{ whiteSpace: 'nowrap' }}>
        <thead>
          <tr>
            <th>신청일시</th>
            <th>이름</th>
            <th>애칭</th>
            <th>이메일</th>
            <th>생년월일</th>
            <th>국적</th>
            <th>거주도시</th>
            <th>등록 상황</th> 
            <th>메모</th>
          </tr>
        </thead>
        <tbody>
        {filteredStudents.map((student, index) => (  // 변경된 부분
          <tr key={index}>
            <td>{student.createdAt}</td>
            <td>{student.User.username}</td>
            <td>{student.Nickname}</td>
            <td>{student.User.email}</td>
            <td>{student.User.birth}</td>
            <td>{student.User.Nationality}</td>
            <td>{student.User.currentCity}</td>
            <td>{student.StudentState === 0 ? "잠정등록" : student.StudentState}</td>
            <td><button className="btn btn-secondary">메모</button></td>

          </tr>
        ))}
      </tbody>
      </table>
      <button className="btn btn-info">더 보기</button>
    </div>
  );
};

export default StudentManagement;
